import Fullpage from "@fullpage/react-fullpage";
import './App.css';

function App() {
  const ww=[
      [
          {
              id:1,
              name:'w'
          },
          {
              id:3,
              name:'z'
          }
      ],
      [
          {
              id:2,
              name: 'a'
          }
      ]
  ];

  return (
      <div>
          {ww.map(s => {
            return s.map(v => {
                return <div>{v.name}</div>
            })
          })}
      </div>
  );
}

export default App;
